import React from 'react';
import { motion } from 'framer-motion';
import { ArrowRight, Sparkles, Code, Heart, Rocket } from 'lucide-react';

const Hero = () => {
  const floatingElements = [
    { icon: Code, delay: 0.2, x: 100, y: 50 },
    { icon: Heart, delay: 0.4, x: -80, y: 80 },
    { icon: Sparkles, delay: 0.6, x: 120, y: -60 },
    { icon: Rocket, delay: 0.8, x: -100, y: -40 }
  ];

  return (
    <section id="home" className="min-h-screen flex items-center justify-center relative overflow-hidden bg-gradient-to-br from-blue-50 via-white to-lime-50">
      {/* Floating Background Elements */}
      {floatingElements.map((element, index) => {
        const Icon = element.icon;
        return (
          <motion.div
            key={index}
            className="absolute text-lime-200"
            initial={{ opacity: 0, scale: 0 }}
            animate={{ 
              opacity: 0.3, 
              scale: 1,
              x: [0, element.x, 0],
              y: [0, element.y, 0]
            }}
            transition={{ 
              delay: element.delay,
              duration: 6,
              repeat: Infinity,
              repeatType: "reverse"
            }}
            style={{ 
              left: `${20 + index * 20}%`, 
              top: `${30 + index * 15}%` 
            }}
          >
            <Icon className="w-16 h-16" />
          </motion.div>
        );
      })}

      <div className="container mx-auto px-6 py-20 text-center relative z-10">
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="max-w-4xl mx-auto"
        >
          <motion.div
            className="inline-flex items-center gap-2 px-4 py-2 bg-lime-100 rounded-full text-lime-700 font-medium mb-6"
            initial={{ opacity: 0, scale: 0.8 }}
            animate={{ opacity: 1, scale: 1 }}
            transition={{ delay: 0.3 }}
          >
            <Heart className="w-4 h-4" />
            Innovamos con el corazÃ³n de una familia
          </motion.div>

          <motion.h1
            className="text-5xl md:text-7xl font-bold mb-6 leading-tight"
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: 0.4, duration: 0.8 }}
          >
            <span className="bg-gradient-to-r from-blue-600 via-purple-600 to-lime-500 bg-clip-text text-transparent">
              LIMELAB
            </span>
            <br />
            <span className="text-gray-800">Technologies</span>
          </motion.h1>

          <motion.p
            className="text-xl md:text-2xl text-gray-600 mb-8 max-w-3xl mx-auto leading-relaxed"
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: 0.6, duration: 0.8 }}
          >
            Desarrollamos soluciones tecnolÃ³gicas que mejoran la vida de las personas, 
            integrando <span className="text-lime-600 font-semibold">innovaciÃ³n</span>, 
            <span className="text-blue-600 font-semibold"> empatÃ­a</span> y el 
            <span className="text-purple-600 font-semibold"> compromiso</span> de una empresa familiar.
          </motion.p>

          <motion.div
            className="flex flex-col sm:flex-row gap-4 justify-center items-center"
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: 0.8, duration: 0.8 }}
          >
            <motion.button
              className="px-8 py-4 bg-gradient-to-r from-blue-500 to-lime-500 text-white font-semibold rounded-2xl shadow-xl hover:shadow-2xl transition-all duration-300 flex items-center gap-2"
              whileHover={{ scale: 1.05, y: -2 }}
              whileTap={{ scale: 0.95 }}
            >
              Conoce nuestros servicios
              <ArrowRight className="w-5 h-5" />
            </motion.button>

            <motion.button
              className="px-8 py-4 border-2 border-gray-300 text-gray-700 font-semibold rounded-2xl hover:border-lime-500 hover:text-lime-600 transition-all duration-300"
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
            >
              Nuestra historia
            </motion.button>
          </motion.div>

          <motion.div
            className="mt-16 grid grid-cols-1 md:grid-cols-3 gap-8 max-w-4xl mx-auto"
            initial={{ opacity: 0, y: 50 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: 1, duration: 0.8 }}
          >
            {[
              { number: "100+", label: "Proyectos Completados", color: "from-blue-500 to-blue-600" },
              { number: "50+", label: "Clientes Satisfechos", color: "from-lime-500 to-green-600" },
              { number: "5+", label: "AÃ±os de Experiencia", color: "from-purple-500 to-pink-600" }
            ].map((stat, index) => (
              <motion.div
                key={index}
                className="text-center"
                initial={{ opacity: 0, scale: 0.8 }}
                animate={{ opacity: 1, scale: 1 }}
                transition={{ delay: 1.2 + index * 0.2 }}
              >
                <div className={`text-4xl font-bold bg-gradient-to-r ${stat.color} bg-clip-text text-transparent mb-2`}>
                  {stat.number}
                </div>
                <div className="text-gray-600 font-medium">{stat.label}</div>
              </motion.div>
            ))}
          </motion.div>
        </motion.div>
      </div>
    </section>
  );
};

export default Hero;
